import React from "react";
import { useSpring, animated } from "react-spring";
import "./Nt.module.scss"; // Import your CSS file for styling

const Nt = () => {
  const { nProps, tProps } = useSpring({
    nProps: { opacity: 1, transform: "translateY(0px)" },
    tProps: { opacity: 1, transform: "translateY(0px)" },
    from: {
      nProps: { opacity: 0, transform: "translateY(100px)" },
      tProps: { opacity: 0, transform: "translateY(100px)" },
    },
    config: { tension: 100, friction: 20 },
  });

  return (
    <div className="logo-container">
      <animated.div className="n" style={nProps}>
        N
      </animated.div>
      <animated.div className="t" style={tProps}>
        T
      </animated.div>
    </div>
  );
};

export default Nt;
